import React, { useState } from "react";
import {
  View,
  Text,
  TextInput,
  TouchableOpacity,
  StyleSheet,
  Image,
  onPress,
} from "react-native";
import Icon from "react-native-vector-icons/FontAwesome";

const OrderScreen = ({ navigation }) => {
  const [showDetails, setShowDetails] = useState(false);

  const toggleDetails = () => {
    setShowDetails(!showDetails);
  };

  return (
    <View style={styles.container}>
      <View style={styles.header}>
        <TouchableOpacity onPress={() => navigation.goBack()}>
          <Icon name="bars" size={20} color="black" style={styles.bars} />
        </TouchableOpacity>
        <View style={styles.logoContainer}>
          <Image
            source={require("../img/logo.png")}
            style={styles.logoimage}
            accessible={true}
            accessibilityLabel={"logo"}
          />
        </View>
      </View>
      <TouchableOpacity style={styles.orderButton} onPress={toggleDetails}>
        <Text style={styles.orderNo}>Order No. 12345</Text>
        <View style={styles.orderDetails}>
          <Text style={styles.orderDate}>June 3, 2023</Text>
          <Icon
            name={showDetails ? "angle-up" : "angle-down"}
            size={20}
            color="black"
          />
        </View>
      </TouchableOpacity>
      {showDetails && (
        <View style={styles.orderDetailsCenter}>
          <View style={styles.orderDetailsContainer}>
            <View style={styles.orderDetail}>
              <View style={styles.productContainer}>
                <Image
                  source={require("../img/Lawn.png")}
                  style={styles.productImage}
                  accessible={true}
                  accessibilityLabel={"product1"}
                />
                <View style={styles.productDetails}>
                  <Text style={styles.productName}>Product 1</Text>
                  <Text style={styles.productPrice}>$10.00</Text>
                </View>
              </View>
            </View>
            <View style={styles.orderDetail}>
              <View style={styles.productContainer}>
                <Image
                  source={require("../img/Lawn.png")}
                  style={styles.productImage}
                  accessible={true}
                  accessibilityLabel={"product2"}
                />
                <View style={styles.productDetails}>
                  <Text style={styles.productName}>Product 2</Text>
                  <Text style={styles.productPrice}>$15.00</Text>
                </View>
              </View>
            </View>
            <View style={styles.orderDetail}>
              <View style={styles.productContainer}>
                <Image
                  source={require("../img/Lawn.png")}
                  style={styles.productImage}
                  accessible={true}
                  accessibilityLabel={"product3"}
                />
                <View style={styles.productDetails}>
                  <Text style={styles.productName}>Product 3</Text>
                  <Text style={styles.productPrice}>$20.00</Text>
                </View>
              </View>
            </View>
            <View style={styles.orderTotal}>
              <Text style={styles.orderTotalLabel}>Total:</Text>
              <Text style={styles.orderTotalValue}>$45.00</Text>
            </View>
          </View>
        </View>
      )}
      <View style={[styles.footer, { position: "absolute", bottom: 0 }]}>
        <Image source={require("../img/home.png")} style={styles.footerIcon} />
        <Image
          source={require("../img/favourite.png")}
          style={styles.footerIcon}
        />
        <Image
          source={require("../img/message.png")}
          style={styles.footerIcon}
        />
        <Image
          source={require("../img/more.png")}
          style={[styles.footerIcon, { marginRight: 0 }]}
        />
      </View>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#F2F2F2",
  },
  header: {
    height: 74,
    flexDirection: "row",
    backgroundColor: "white",
    justifyContent: "center",
    alignItems: "center",
    paddingHorizontal: 10,
  },
  bars: {
    marginRight: "auto",
  },
  logoContainer: {
    alignItems: "center",
    width: "50%",
  },
  logoimage: {
    width: 208,
    height: 41,
  },
  orderButton: {
    flexDirection: "row",
    justifyContent: "space-between",
    alignItems: "center",
    backgroundColor: "white",
    paddingVertical: 10,
    paddingHorizontal: 20,
    marginTop: 20,
  },
  orderNo: {
    fontWeight: "bold",
    fontSize: 16,
    letterSpacing: 2,
  },
  orderDetails: {
    flexDirection: "row",
    alignItems: "center",
  },
  orderDate: {
    marginRight: 10,
    fontSize: 14,
  },
  orderDetailsCenter: {
    flexDirection: "row",
    justifyContent: "center",
  },
  orderDetailsContainer: {
    backgroundColor: "white",
    flexDirection: "column",
    justifyContent: "center",
    alignItems: "center",
    marginTop: 10,
    paddingVertical: 10,
    paddingHorizontal: 20,
  },
  orderDetail: {
    width: "100%",
    borderBottomWidth: 0.5,
    borderColor: "#ccc",
    paddingVertical: 10,
  },
  productContainer: {
    flexDirection: "row",
    alignItems: "center",
  },
  productImage: {
    height: 50,
    width: 50,
    marginRight: 10,
  },
  productDetails: {
    flexDirection: "column",
    alignItems: "flex-start",
    justifyContent: "center",
  },
  productName: {
    fontSize: 15,
    fontWeight: "bold",
  },
  productPrice: {
    fontSize: 12,
    color: "#888",
  },
  orderTotal: {
    flexDirection: "row",
    alignItems: "center",
    justifyContent: "flex-end",
    marginTop: 10,
  },
  orderTotalLabel: {
    fontSize: 15,
    fontWeight: "bold",
    marginRight: 10,
  },
  orderTotalValue: {
    fontSize: 15,
    fontWeight: "bold",
    color: "#888",
  },
  footer: {
    height: 50,
    backgroundColor: "#ccc",
    justifyContent: "center",
    alignItems: "center",
  },
  footerText: {
    color: "#fff",
  },
});

export default OrderScreen;
